histogram_quantile(
    0.99, sum(
        rate(
            nginx_http_request_duration_seconds_bucket
            {
                path=~"/ui/api/v1/.*",
                status_code=~"200",
                method=~"POST"
            }[$__interval])) by (le)
    )

